.select {
	position: relative;
	display: inline-block;
	width: 100%
}

.select select {
	font-size: 14px;
	display: inline-block;
	width: 100%;
	cursor: pointer;
	padding: 10px 15px;
	outline: 0;
	border: none;
	border-radius: 8px;
	overflow: hidden;
	background: #334;
	color: #ccc;
	appearance: none;
	-webkit-appearance: none;
	-moz-appearance: none
}

.select select::-ms-expand {
	display: none
}

.select select:focus,
.select select:hover {
	color: #ddd;
	background: #445
}

.select select:disabled {
	opacity: .5;
	pointer-events: none
}

.select_arrow {
	position: absolute;
	pointer-events: none;
	top: 12px;
	right: 15px;
	width: 0;
	height: 0;
	border: solid #aaa;
	border-width: 0 3px 3px 0;
	display: inline-block;
	padding: 3px;
	transform: rotate(45deg);
	-webkit-transform: rotate(45deg)
}

.select select:focus~.select_arrow,
.select select:hover~.select_arrow {
	border-color: #ccc
}

.select select:disabled~.select_arrow {
	border-top-color: #ccc
}

.svg-inline--fa {
	display: inline-block;
	font-size: inherit;
	height: 1em;
	overflow: visible;
	vertical-align: -.125em
}

.svg-inline--fa.fa-w-14 {
	width: .875em
}

body,
html {
	height: 100%
}

body {
	margin: 0;
	font-family: "Roboto", -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Helvetica, Arial, sans-serif
}

.content {
	grid-area: content;
	height: 100%;
	width: 100%
}

#app {
	display: grid;
	grid-template-columns: 1fr;
	grid-template-rows: 72px 1fr;
	grid-template-areas: "header" "content";
	width: 100%
}

a {
	color: #4078c0;
	text-decoration: none
}

.flex {
	flex: 1
}

button:focus,
input:focus,
textarea:focus {
	outline: 0
}

.faq {
	max-width: 900px;
	margin-left: auto;
	margin-right: auto;
	margin-bottom: 64px
}

.faq #faq {
	text-align: center;
	font-weight: 500
}

.faq .question {
	margin-bottom: 46px
}

.faq table {
	border-collapse: collapse
}

.faq td {
	border: 1px solid #dfdfdf;
	padding: 8px 12px
}

@media (max-width:1100px) {
	#app {
		grid-template-rows: auto 1fr
	}
}

.codeblock {
	background: #334;
	padding: 12px 12px 4px 12px;
	max-width: calc(100vw - 56px);
	border-radius: 6px;
	margin: 0;
	color: #c9c5c4;
	font-size: 15px;
	position: relative;
	font-family: "Roboto Mono", "Courier New", Menlo, "DejaVu Sans Mono", Monaco, Courier, monospace
}

.codeblock .play-btn-fixed {
	position: absolute;
	top: 10px;
	right: 10px
}

.codeblock pre {
	overflow-x: auto;
	overflow-y: hidden;
	line-height: 1.2;
	font-family: "Roboto Mono", "Courier New", Menlo, "DejaVu Sans Mono", Monaco, Courier, monospace;
	white-space: pre-wrap
}

.codeblock textarea {
	font-size: 15px;
	line-height: 1.2;
	font-family: "Roboto Mono", "Courier New", Menlo, "DejaVu Sans Mono", Monaco, Courier, monospace;
	position: absolute;
	top: 25px;
	left: 10px;
	height: calc(100% - 48px);
	width: calc(100% - 22px);
	caret-color: #fff;
	color: transparent;
	background: 0 0;
	overflow: hidden;
	border: none;
	resize: none
}

.codeblock textarea.no-header {
	top: 25px
}

.codeblock .titlebar {
	display: flex;
	align-items: center;
	margin-bottom: 6px;
	position: relative;
	top: -2px
}

.codeblock .play-btn {
	background: 0 0;
	border: none;
	margin: 0;
	background: #ffffff33;
	color: #ffeeeecf;
	border-radius: 4px;
	padding: 4px 12px;
	font-size: 12px;
	z-index: 10;
	cursor: pointer
}

.codeblock .play-btn svg {
	height: 1.1em
}

.codeblock .play-btn:hover {
	background: #ffffff55;
	color: #ffeeeedd
}

.codeblock .keyword {
	color: #dcd02d
}

.codeblock .return {
	color: #ea3b7b
}

.codeblock .key {
	color: #5f84ba
}

.codeblock .string {
	color: #ca763c
}

.codeblock .number {
	color: #b068e7
}

.codeblock .comment,
.codeblock .separator {
	color: #9e9795
}

.codeblock .definition,
.codeblock .type {
	color: #c5ac41
}

.documentation {
	display: flex;
	justify-content: center;
	max-width: 1200px;
	height: calc(100vh - 72px);
	padding-right: 6px;
	margin-left: auto;
	margin-right: auto;
	overflow-y: scroll
}

.documentation .toc {
	margin-right: 32px
}

.documentation .toc ul {
	padding-inline-start: 24px
}

.documentation .markdown {
	margin-left: 32px;
	padding-bottom: 64px;
	max-width: calc(100vw - 24px)
}

.documentation .markdown h1,
.documentation .markdown h2,
.documentation .markdown h3 {
	font-weight: 400
}

.documentation .markdown h1 {
	margin: 12px 0
}

.documentation .markdown h2 {
	margin: 32px 0 8px 0
}

.documentation .markdown h3 {
	margin: 8px 0
}

.documentation .markdown a {
	word-break: break-word
}

.documentation .markdown p {
	margin: 8px 0
}

.documentation .markdown p code {
	background: #eee;
	padding: 2px 6px;
	border-radius: 5px;
	font-size: 14px
}

.documentation .markdown .markdownIt-Anchor {
	color: #c3cad6
}

.documentation .markdown .markdownIt-Anchor:hover {
	color: #4078c0
}

.documentation .markdown .codeblock {
	margin-bottom: 4px
}

@media (max-width:1100px) {
	.documentation {
		height: calc(100vh - 143px)
	}
}

@media (max-width:845px) {
	.documentation {
		height: calc(100vh - 154px)
	}
}

@media (max-width:800px) {
	.documentation {
		flex-direction: column;
		align-items: center;
		height: 100%;
		overflow-y: visible;
		padding-right: 0
	}
	.documentation .markdown {
		margin-left: 8px
	}
	.documentation .toc {
		margin-right: 0;
		margin-bottom: 32px
	}
}

