.landing .hero {
	display: flex;
	justify-content: space-evenly;
	align-items: center;
	width: calc(100% - 32px);
	max-width: 1200px;
	color: #444;
	margin: 32px 0;
}

.landing .hero .info {
	max-width: 500px
}

.landing .hero .info h1 {
	font-weight: 300;
	margin: 0 0 0 -2px
}

.landing .hero .info p {
	margin: 4px 0
}

.landing .hero .button {
	background: #222;
	color: #fff;
	margin-top: 16px;
	margin-right: 8px;
	padding: 7px 14px 6px 8px;
	border-radius: 6px;
	display: inline-flex;
	/*align-items: center;*/
	cursor: pointer;
	position: relative
}

.landing .hero .button .svg-inline--fa {
	width: 32px;
	height: 32px;
	margin-right: 4px
}

.landing .hero .button .options-container .options {
	position: absolute;
	background: #fff;
	color: #333;
	border: 1px solid #eee;
	right: 0;
	top: 54px;
	box-sizing: border-box;
	border-radius: 6px;
	opacity: 0;
	pointer-events: none;
	transform: translateY(-12px);
	transition: all .2s cubic-bezier(.67, .16, .4, 1)
}

.landing .hero .button .options-container .options .dl-option {
	display: flex;
	padding: 8px 8px 8px 6px;
	align-items: center;
	color: #333
}

.landing .hero .button .options-container .options .dl-option .name {
	flex: 1;
	margin-right: 32px
}

.landing .hero .button .options-container .options .dl-option .size {
	color: #818e9c;
	font-size: 15px
}

.landing .hero .button .options-container .options .dl-option svg {
	margin-right: 6px;
	width: 22px;
	height: 22px
}

.landing .hero .button .options-container .options .dl-option:hover {
	background: #f7f7f7
}

.landing .hero .button .options-container:focus {
	outline: 0
}

.landing .hero .button .options-container:focus .options {
	opacity: 1;
	pointer-events: all;
	transform: translateY(0)
}

.landing .hero .button .options-container:active .right-icon {
	transform: translateY(3px)
}

.landing .hero .button .options-container .right-icon {
	width: 18px;
	padding: 12px 2px;
	cursor: pointer;
	transition: transform .1s
}

.landing .hero .button .text {
	display: flex;
	flex-direction: column;
	margin-right: 10px
}

.landing .hero .button .text .link {
	margin: 0 4px 0 8px;
	font-size: 15px
}

.landing .hero .button .text .details {
	color: #ddd;
	padding: 0 4px;
	font-size: 13px;
	line-height: 18px;
	border-radius: 4px;
	margin-left: 5px
}

.landing .hero .button .text .details svg {
	fill: #ddd;
	position: relative;
	top: 2px;
	left: -1px
}

.landing .hero .button .changelog,
.landing .hero .button .fast {
	position: absolute;
	bottom: -24px;
	left: 0;
	color: #333;
	text-decoration: none
}

.landing .hero .button .changelog {
	left: auto;
	right: 0
}

.landing .hero .examples {
	margin-right: 32px;
	display: flex;
	flex-direction: column;
	align-items: center;
	position:relative;
	top: -30px;
}

.landing .hero .examples .menu {
	margin-top: 12px;
	display: flex;
	justify-content: center;
	align-items: center
}

.landing .hero .examples .menu button {
	background: 0 0;
	border: none;
	cursor: pointer
}

.landing .hero .examples .menu button i {
	font-size: 32px!important;
	color: #333
}

.landing .hero .examples .menu select {
	font-size: 18px
}

.landing .hero .examples .menu .select {
