	width: 200px
}

.landing .social {
	margin-top: 16px;
	padding: 9px 12px;
	border-radius: 6px;
	margin-right: 38px;
	text-align: center
}

.landing .social p {
	color: #444
}

.landing .social svg {
	font-size: 28px;
	margin: 0 12px 0 0;
	cursor: pointer;
	color: #949fad;
	pointer: cursor
}

.landing .social svg:hover {
