}

.landing .social .fa-discord {
	color: #7289da
}

.landing .social .fa-twitter {
	color: #00acee
}

.landing .links {
	margin-top: 12px;
	margin-right: 38px;
	display: flex;
	flex-direction: row;
	flex-wrap: wrap;
	justify-content: space-between;
	font-size: 18px
}

.landing .links a:hover {
	opacity: .9
}

.landing {
	display: flex;
	flex-direction: column;
	justify-content: flex-start;
	align-items: center;
	background: linear-gradient(168deg, #fff 800px, #f6f9fc 800px);
	padding-bottom: 32px
}

.landing .section {
	display: flex;
	max-width: 1100px;
	width: calc(100vw - 32px);
	justify-content: space-around;
	margin-top: 32px;
	background: #fff;
	color: #222;
	border-radius: 6px;
	border: 1px solid #efefef
}

.landing .section h1,
.landing .section h2 {
	font-weight: 300;
	margin: 0
}

.landing .section .block {
	flex: 1;
	padding: 18px 16px;
	margin: 12px;
	border-radius: 6px;
}

.landing .section .block td {
	width: 120px;
	line-height: 1.5
}

.landing .section .block td .sidenote {
	font-size: 75%;
	position: relative;
	top: -5px
}

.landing .section .block pre {
	white-space: pre-wrap;
	word-break: break-word
}

.landing ul {
	padding-inline-start: 22px
}

.landing i {
	max-width: calc(100vw - 64px);
	text-align: center;
	font-size: 14px
}

@media (max-width:1500px) {
	.landing .hero .examples .codeblock {
		min-width: auto
	}
}

@media (max-width:1200px) {
	.landing .hero {
		margin: 32px 0;
		flex-direction: column
	}
	.landing .hero .info {
		margin-bottom: 32px;
		text-align: center
	}
	.landing .hero .info .button {
		text-align: left
	}
	.landing .hero .info .button:last-child {
		margin-right: 0
	}
	.landing .hero .info .links,
	.landing .hero .info .social {
		margin-right: 0
	}
	.landing .hero .info .social {
		margin-top: 16px
	}
	.landing .hero .info .social i {
		font-size: 28px;
		margin-left: 6px;
		margin-right: 6px
	}
	.landing .hero .examples {
		margin: 0 8px 0 8px!important
	}
	.landing .editors {
		margin-right: 0
	}
}

@media (max-width:750px) {
	.landing .section {
		flex-direction: column
	}
}

.playground {
	display: flex;
	flex-direction: column
}

.playground .editor {
	display: flex;
	flex: 1
}

.playground .editor .codeblock,
.playground .editor .output {
	flex: 1;
	margin: 6px
}

.playground .select {
	margin-left: 8px;
	width: 220px
}

@media (max-width:1100px) {
	.playground .editor {
		flex-direction: column
	}
	.playground .editor .codeblock {
		max-width: calc(100vw - 36px)
	}
}

.editors-info {
	max-width: 600px;
	text-align: center;
	margin-right: auto;
	margin-left: auto;
	margin-top: 32px
}

.editors-info h1 {
	font-weight: 300;
	margin: 0 0 0 -2px
}

.editors-info p {
	margin: 4px 0
}

.editors {
	display: flex;
	justify-content: space-evenly;
	width: calc(100vw - 32px);
	max-width: 600px;
	margin-top: 32px;
	margin-right: auto;
	margin-left: auto;
	flex-wrap: wrap
}

.editors .editor {
	display: flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
	background: #fff;
	color: #000;
	height: 100px;
	width: 125px;
	border: 1px solid #efefef;
	border-radius: 6px;
	text-decoration: none;
	box-shadow: none;
	cursor: pointer;
	margin-bottom: 16px;
	transition: transform .1s, box-shadow .1s
}

.editors .editor:hover {
	transform: translateY(-3px);
	box-shadow: 0 6px 8px 0 rgba(0, 0, 0, .05), 0 16px 32px -2px rgba(0, 0, 0, .05)
}

.editors .editor img {
	flex: 0;
	height: 42px;
	margin-bottom: 6px
}

.built-in-v {
	display: grid;
	grid-template-columns: 1fr 1fr;
	grid-auto-flow: row dense;
	margin-top: 16px
}

.built-in-v .first,
.built-in-v .second {
	padding-bottom: 16px
}

.built-in-v .first {
	grid-column-start: 1;
	padding-right: 70px
}

.built-in-v .second {
	grid-column-start: 2
}

@media (max-width:750px) {
	.built-in-v {
		grid-template-columns: 1fr
	}
	.built-in-v .first,
	.built-in-v .second {
		grid-column-start: 1
	}
}

